        "value": "<style type=\"text/css\">\n#T_e71f7 table {\n  text-align: left;\n  white-space: pre-wrap;\n}\n#T_e71f7 thead {\n  text-align: left;\n  white-space: pre-wrap;\n}\n#T_e71f7 tbody {\n  text-align: left;\n  white-space: pre-wrap;\n}\n#T_e71f7 th {\n  text-align: left;\n  white-space: pre-wrap;\n}\n#T_e71f7 td {\n  text-align: left;\n  white-space: pre-wrap;\n}\n</style>\n<table id=\"T_e71f7\">\n  <thead>\n    <tr>\n      <th id=\"T_e71f7_level0_col0\" class=\"col_heading level0 col0\" >Status</th>\n      <th id=\"T_e71f7_level0_col1\" class=\"col_heading level0 col1\" >Check</th>\n      <th id=\"T_e71f7_level0_col2\" class=\"col_heading level0 col2\" >Condition</th>\n      <th id=\"T_e71f7_level0_col3\" class=\"col_heading level0 col3\" >More Info</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td id=\"T_e71f7_row0_col0\" class=\"data row0 col0\" ><div style=\"color: green;text-align: center\">\u2713</div></td>\n      <td id=\"T_e71f7_row0_col1\" class=\"data row0 col1\" ><a href=\"#TrainTestPredictionDrift_IILNDV93EKX84BY21QV2EQKIH-section-FT5GS\">Train Test Prediction Drift</a></td>\n      <td id=\"T_e71f7_row0_col2\" class=\"data row0 col2\" >categorical drift score < 0.15 and numerical drift score < 0.075</td>\n      <td id=\"T_e71f7_row0_col3\" class=\"data row0 col3\" >Found model prediction Cramer's V drift score of 0.01</td>\n    </tr>\n    <tr>\n      <td id=\"T_e71f7_row1_col0\" class=\"data row1 col0\" ><div style=\"color: green;text-align: center\">\u2713</div></td>\n      <td id=\"T_e71f7_row1_col1\" class=\"data row1 col1\" ><a href=\"#WeakSegmentsPerformance-TrainDataset_IILNDV93EKX84BY21QV2EQKIH-section-FT5GS\">Weak Segments Performance - Train Dataset</a></td>\n      <td id=\"T_e71f7_row1_col2\" class=\"data row1 col2\" >The relative performance of weakest segment is greater than 80% of average model performance.</td>\n      <td id=\"T_e71f7_row1_col3\" class=\"data row1 col3\" >Found a segment with Accuracy score of 0.369 in
